import React, { Component } from "react";
import socketIOClient from "socket.io-client";
import _ from 'underscore';
import './style.scss';

import Result from './result/RacingResults';


class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      response: false,
      horses: [],
    };
  }


  render() {
    return (
        <div>
          <table id='results'>
            <tbody>
              <tr>
                <th>No</th>
                <th>Horse</th>
                <th>Time</th>
              </tr>
                <Result />
            </tbody>
          </table>
        </div>
    );
  }
}
export default App;


